import React from 'react';
import Typing from 'react-typing-animation';

const Intro = () => {
    return (
        <div>
            <Typing
                speed= {100}>
                <span>이 설문은 영국에서 시작되어</span>
                <Typing.Backspace count= {15}/>
            </Typing>
        </div>
    );
};

export default Intro;
